  KEY `CbteVta` (`CbteVta`),
  KEY `CbteCpra` (`CbteCpra`),
  CONSTRAINT `financiero_compra_fk` FOREIGN KEY (`CbteCpra`) REFERENCES `cpracabecera` (`Id`) ON DELETE CASCADE,
  CONSTRAINT `financiero_concepto_fk` FOREIGN KEY (`Concepto`) REFERENCES `conceptobancario` (`codigo`) ON UPDATE CASCADE,
  CONSTRAINT `financiero_cuenta_fk` FOREIGN KEY (`Cuenta`) REFERENCES `cuentabancaria` (`codigo`) ON UPDATE CASCADE,
  CONSTRAINT `financiero_vta_fk` FOREIGN KEY (`CbteVta`) REFERENCES `cbtecabecera` (`Id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

