#
# Definition for the `REGINFO_CV_VENTAS_CBTE` procedure : 
#

DROP PROCEDURE IF EXISTS `REGINFO_CV_VENTAS_CBTE`;

CREATE PROCEDURE `REGINFO_CV_VENTAS_CBTE`(periodo VARCHAR(6))
    NOT DETERMINISTIC
    SQL SECURITY DEFINER
    COMMENT ''
BEGIN
SELECT d.`CbteFecha` FechaComprobante,
       LPAD(CAST(d.`CbteTipo` AS CHAR),3,'0') TipoComprobante,
       LPAD(CAST(d.`CbtePtoVta` AS CHAR),5,'0') PuntoVenta,
       LPAD(CAST(d.`CbteNumero` AS CHAR),20,'0') NumeroComprobante,
       LPAD(CAST(d.`CbteNumero` AS CHAR),20,'0') NumeroComprobanteHasta,
       d.`DocumentoTipo` CodigoDocumentoComprador,
       LPAD(CAST(d.`DocumentoNro` AS CHAR),20,'0') NumeroIdentificacionComprador,
       RPAD(LEFT(d.`RazonSocial`,30),30,' ') DenominacionComprador,
       LPAD(CAST(TRUNCATE(ABS(d.`ImporteTotal`)*100,0) AS CHAR),15,'0') ImporteTotalOperacion,
       LPAD(CAST(TRUNCATE(ABS(d.`ImporteTotalConceptos`)*100,0) AS CHAR),15,'0') ImporteTotalNoGravado,
       LPAD('0',15,'0') PercepcionNoCategorizados,
       LPAD(CAST(TRUNCATE(ABS(d.`ImporteOpExentas`)*100,0) AS CHAR),15,'0') ImporteOperacionesExentas,
       LPAD(CAST(TRUNCATE(ABS(d.impnacional)*100,0) AS CHAR),15,'0') ImporteImpuestosNacionales,
       LPAD(CAST(TRUNCATE(ABS(d.impprovincial)*100,0) AS CHAR),15,'0') ImportePercepcionesIngresosBrutos,
       LPAD(CAST(TRUNCATE(ABS(d.impmunicipal)*100,0) AS CHAR),15,'0') ImportePercepcionesImpuestosMunicipales,
       LPAD(CAST(TRUNCATE(ABS(d.impimpint)*100,0) AS CHAR),15,'0') ImporteImpuestosInternos,
       'PES' CodigoMoneda,
       CONCAT(LPAD('1',4,'0'),LPAD('0',6,'0')) TipoCambio,
       IF(d.alicuotas=0,1,d.alicuotas) CantidadAlicuotasIVA,
       CASE d.alicuotas
            WHEN 0 THEN 'E'
            ELSE ' '
       END AS CodigoOperacion,
       LPAD(CAST(TRUNCATE(ABS(d.impotros)*100,0) AS CHAR),15,'0') OtrosTributos,
       '00000000' FechaVtoPago
FROM (
SELECT c.*,
IFNULL(tribnac.importe ,0) impnacional,
IFNULL(tribpro.importe ,0) impprovincial,
IFNULL(tribmun.importe ,0) impmunicipal,
IFNULL(tribint.importe ,0) impimpint,
IFNULL(tribotro.importe ,0) impotros,
IFNULL(alic.alicuotas ,0) alicuotas
FROM `cbtecabecera` c
LEFT JOIN
(SELECT cbtetributo.`CbteId`,SUM(`cbtetributo`.`Importe`) importe FROM `cbtetributo` WHERE `cbtetributo`.`Codigo`=1 GROUP BY cbtetributo.`CbteId`,`cbtetributo`.`Codigo`) tribnac ON c.`Id` = tribnac.cbteid
LEFT JOIN
(SELECT cbtetributo.`CbteId`,SUM(`cbtetributo`.`Importe`) importe FROM `cbtetributo` WHERE `cbtetributo`.`Codigo`=2 GROUP BY cbtetributo.`CbteId`,`cbtetributo`.`Codigo`) tribpro ON c.`Id` = tribpro.cbteid
LEFT JOIN
(SELECT cbtetributo.`CbteId`,SUM(`cbtetributo`.`Importe`) importe FROM `cbtetributo` WHERE `cbtetributo`.`Codigo`=3 GROUP BY cbtetributo.`CbteId`,`cbtetributo`.`Codigo`) tribmun ON c.`Id` = tribmun.cbteid
LEFT JOIN
(SELECT cbtetributo.`CbteId`,SUM(`cbtetributo`.`Importe`) importe FROM `cbtetributo` WHERE `cbtetributo`.`Codigo`=4 GROUP BY cbtetributo.`CbteId`,`cbtetributo`.`Codigo`) tribint ON c.`Id` = tribint.cbteid
LEFT JOIN
(SELECT cbtetributo.`CbteId`,SUM(`cbtetributo`.`Importe`) importe FROM `cbtetributo` WHERE `cbtetributo`.`Codigo`=99 GROUP BY cbtetributo.`CbteId`,`cbtetributo`.`Codigo`) tribotro ON c.`Id` = tribotro.cbteid
LEFT JOIN
(SELECT `cbtealicuota`.`CbteId`,COUNT(*) alicuotas FROM `cbtealicuota` GROUP BY cbtealicuota.`CbteId`) alic ON c.`Id` = alic.cbteid
WHERE c.`CbteTipo` not in (991,992,993,994,995,996,91) ) d
WHERE DATE_FORMAT(d.`CbteFecha`,'%Y%m')=periodo;

END;

#
# Definition for the `GetCompraArticulo` function : 
#

DROP FUNCTION IF EXISTS `GetCompraArticulo`;

CREATE FUNCTION `GetCompraArticulo`(plu INTEGER(11), fecha DATE)
    RETURNS double
    NOT DETERMINISTIC
    SQL SECURITY DEFINER
    COMMENT ''
BEGIN


RETURN (
SELECT IFNULL(
(SELECT IFNULL(a.`Importe`,0) Importe
FROM `cpracabecera` c, `cpraarticulo` a
WHERE c.id=a.`CbteId`
AND c.`CbteTipo` IN (1,6,81,82,11,51,83,111,12,991)
AND a.`Codigo`=plu
AND CAST(c.`CbteFecha` AS DATE) <= fecha
ORDER BY c.`CbteFecha` DESC LIMIT 1),0));



END;

#
# Definition for the `GetExistencia` function : 
#

DROP FUNCTION IF EXISTS `GetExistencia`;

CREATE FUNCTION `GetExistencia`(plu VARCHAR(15))
    RETURNS double
    NOT DETERMINISTIC
    SQL SECURITY DEFINER
    COMMENT ''
BEGIN



return (SELECT IFNULL(SUM(Cantidad),0) Saldo FROM fichastock WHERE articulo=plu GROUP BY articulo);



END;

#
# Definition for the `GetIdLocalidad` function : 
#

DROP FUNCTION IF EXISTS `GetIdLocalidad`;

CREATE FUNCTION `GetIdLocalidad`(cp VARCHAR(10), pcia VARCHAR(15))
    RETURNS int(11)
    NOT DETERMINISTIC
    SQL SECURITY DEFINER
    COMMENT ''
BEGIN



RETURN(SELECT IFNULL(l.`id`,0)

FROM localidad l

WHERE l.`codigopostal` = cp

AND l.`provincia` LIKE CONCAT(pcia,'%')

order by id desc LIMIT 1);





END;

#
# Definition for the `GetSaldoAcumulado` function : 
#

DROP FUNCTION IF EXISTS `GetSaldoAcumulado`;

CREATE FUNCTION `GetSaldoAcumulado`(importe DOUBLE)
    RETURNS double
    NOT DETERMINISTIC
    SQL SECURITY DEFINER
    COMMENT ''
BEGIN

set @saldo = @saldo + importe;

return @saldo;



END;

#
# Definition for the `GetSaldoCliente` function : 
#

DROP FUNCTION IF EXISTS `GetSaldoCliente`;

CREATE FUNCTION `GetSaldoCliente`(p_cliente INTEGER(11), p_hasta VARCHAR(8), p_concepto CHAR(1))
    RETURNS double
    NOT DETERMINISTIC
    SQL SECURITY DEFINER
    COMMENT ''
BEGIN
RETURN (SELECT IFNULL(SUM(Importe),0) Saldo FROM (
(SELECT
CASE t.Tipo
	WHEN 'C' THEN r.`ImporteTotal`*-1
    ELSE r.ImporteTotal
END AS Importe
FROM `cbtecabecera` r,`tipocomprobante` t, cliente
WHERE r.`CbteTipo` = t.`Codigo`
AND r.`ClienteId` = cliente.`id`
AND r.`FormaDePago` = 2
AND CASE p_concepto
	WHEN 'F' THEN r.`CbteTipo` IN (1,6,81,82)
    ELSE r.`CbteTipo` IN (991) END
AND r.`CbteFecha` < p_hasta
AND r.ClienteId = p_cliente)
UNION ALL
(SELECT
IF(t.`Tipo`='C',c.`Importe`*-1,c.`Importe`) Importe
FROM `cbtecabecera` r,`cbteasociado` c,`tipocomprobante` t, cliente
WHERE r.id = c.`CbteId`
AND r.`CbteTipo` = t.`Codigo`
AND r.`ClienteId` = cliente.`id`
AND CASE p_concepto
	WHEN 'F' THEN r.`CbteTipo` NOT IN (1,6,81,82)
    ELSE r.`CbteTipo` NOT IN (991) END
AND r.`CbteFecha` < p_hasta
AND r.ClienteId = p_cliente)
) Saldo);
END;

#
# Definition for the `comprasanuales` view : 
#

DROP VIEW IF EXISTS `comprasanuales`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `comprasanuales` AS 
  select 
    date_format(cast(`c`.`CbteFecha` as date),
    _latin1'%m%Y') AS `Periodo`,
    sum((`c`.`ImporteTotal` * if((`c`.`Tipo` = _utf8'C'),
    -(1),
    1))) AS `TotalVentaBruto`,
    sum((`c`.`ImporteNeto` * if((`c`.`Tipo` = _utf8'C'),
    -(1),
    1))) AS `TotalVentaNeto` 
  from 
    `cpracabecera` `c` 
  where 
    (`c`.`CbteTipo` 
  in 
    (1,2,3,6,7,8,81,82,11,12,13,51,52,53,83)) 
  group by 
    date_format(cast(`c`.`CbteFecha` as date),_latin1'%m%Y');

#
# Definition for the `comprobantes_fiscales` view : 
#

DROP VIEW IF EXISTS `comprobantes_fiscales`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `comprobantes_fiscales` AS 
  select 
    `tipocomprobante`.`Codigo` AS `Codigo`,
    `tipocomprobante`.`Descripcion` AS `Descripcion` 
  from 
    `tipocomprobante` 
  where 
    (`tipocomprobante`.`Codigo` 
  in 
    (1,3,6,8));

#
# Definition for the `listadoprecios` view : 
#

DROP VIEW IF EXISTS `listadoprecios`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `listadoprecios` AS 
  select 
    `rubro`.`id` AS `rubroid`,
    `rubro`.`nombre` AS `rubro`,
    `articulo`.`plu` AS `codigo`,
    `articulo`.`nombre` AS `descripcion`,
    `articulo`.`oferta` AS `oferta`,
    `articulo`.`preciodeventa` AS `NetoR`,
    `articulo`.`preciodeventa2` AS `NetoK`,
    `articulo`.`preciodeventa3` AS `NetoM`,
    `tipocondicioniva`.`Alicuota` AS `Alicuota`,
    `articulo`.`impuestointerno` AS `impuestointR`,
    `articulo`.`impuestointerno` AS `impuestointK`,
    `articulo`.`impuestointerno` AS `impuestointM`,
    `articulo`.`unidaddescripcion` AS `unidad`,
    round(((`articulo`.`preciodeventa` * (1 + (`tipocondicioniva`.`Alicuota` / 100))) + `articulo`.`impuestointerno`),
    3) AS `FinalR`,
    round(((`articulo`.`preciodeventa2` * (1 + (`tipocondicioniva`.`Alicuota` / 100))) + `articulo`.`impuestointerno`),
    3) AS `FinalK`,
    round(((`articulo`.`preciodeventa3` * (1 + (`tipocondicioniva`.`Alicuota` / 100))) + `articulo`.`impuestointerno`),
    3) AS `FinalM`,
    `articulo`.`proveedor` AS `proveedorid` 
  from 
    ((`articulo` join `rubro`) join `tipocondicioniva`) 
  where 
    ((`articulo`.`rubro` = `rubro`.`id`) and (`articulo`.`alicuotaiva` = `tipocondicioniva`.`Codigo`));

#
# Definition for the `localidadescliente` view : 
#

DROP VIEW IF EXISTS `localidadescliente`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `localidadescliente` AS 
  select 
    `localidad`.`id` AS `id`,
    `localidad`.`nombre` AS `nombre`,
    `localidad`.`codigopostal` AS `codigopostal`,
    `localidad`.`provincia` AS `provincia` 
  from 
    (`localidad` join `cliente`) 
  where 
    (`localidad`.`id` = `cliente`.`localidad`) 
  group by 
    `localidad`.`id`;

#
# Definition for the `provincia` view : 
#

DROP VIEW IF EXISTS `provincia`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `provincia` AS 
  select 
    `localidad`.`provincia` AS `Provincia` 
  from 
    `localidad` 
  group by 
    `localidad`.`provincia`;

#
# Definition for the `ventasanuales` view : 
#

DROP VIEW IF EXISTS `ventasanuales`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `ventasanuales` AS 
  select 
    date_format(cast(`c`.`CbteFecha` as date),
    _latin1'%m') AS `Periodo`,
    sum((`c`.`ImporteTotal` * if((`c`.`Tipo` = _utf8'C'),
    -(1),
    1))) AS `TotalVentaBruto`,
    sum((`c`.`ImporteNeto` * if((`c`.`Tipo` = _utf8'C'),
    -(1),
    1))) AS `TotalVentaNeto` 
  from 
    `cbtecabecera` `c` 
  where 
    (`c`.`CbteTipo` 
  in 
    (1,2,3,6,7,8,81,82,11,12,13,51,52,53,83)) 
  group by 
    date_format(cast(`c`.`CbteFecha` as date),_latin1'%m%Y');

